import React, { useState } from 'react';
import axios from 'axios';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTrashAlt } from '@fortawesome/free-solid-svg-icons';
import './CreatePost.css';

function CreatePost() {
    const [title, setTitle] = useState('');
    const [description, setDescription] = useState('');
    const [price, setPrice] = useState('');
    const [picture, setPicture] = useState(null);
    const [picturePreview, setPicturePreview] = useState(null);
    const [errorMessage, setErrorMessage] = useState('');
    const [successMessage, setSuccessMessage] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        setErrorMessage('');
        setSuccessMessage('');

        if (!title || !description || !price) {
            setErrorMessage('Title, description, and price are required');
            return;
        }

        const formData = new FormData();
        formData.append('title', title);
        formData.append('description', description);
        formData.append('price', price);
        formData.append('email', 'user@example.com'); // Replace with actual user email
        if (picture) {
            formData.append('picture', picture);
        }

        axios.post('http://localhost:8081/create-post', formData)
            .then(res => {
                if (res.data.message === "Post created successfully") {
                    setSuccessMessage('Post created successfully');
                    setTitle('');
                    setDescription('');
                    setPrice('');
                    setPicture(null);
                    setPicturePreview(null);
                } else {
                    setErrorMessage('Error creating post');
                }
            })
            .catch(err => {
                setErrorMessage('Error creating post');
                console.error(err);
            });
    };

    const handleFileChange = (e) => {
        const file = e.target.files[0];
        if (file) {
            setPicture(file);
            setPicturePreview(URL.createObjectURL(file));
        }
    };

    const handleRemoveImage = () => {
        setPicture(null);
        setPicturePreview(null);
    };

    return (
        <div className="create-post-container">
            <form onSubmit={handleSubmit} className="create-post-form">
                <h2>Upload an image</h2>
                <div>
                    <label>Title</label>
                    <input
                        type="text"
                        value={title}
                        onChange={(e) => setTitle(e.target.value)}
                    />
                </div>
                <div>
                    <label>Description</label>
                    <textarea
                        value={description}
                        onChange={(e) => setDescription(e.target.value)}
                    ></textarea>
                </div>
                <div>
                    <label>Price</label>
                    <input
                        type="number"
                        step="0.01"
                        value={price}
                        onChange={(e) => setPrice(e.target.value)}
                    />
                </div>
                <div className="file-input-container">
                    <label className="file-input-label">
                        Choose File
                        <input
                            type="file"
                            onChange={handleFileChange}
                        />
                    </label>
                    {picturePreview && (
                        <div className="image-preview">
                            <img src={picturePreview} alt="Selected" />
                            <button type="button" className="remove-image-button" onClick={handleRemoveImage}>
                                <FontAwesomeIcon icon={faTrashAlt} />
                            </button>
                        </div>
                    )}
                </div>
                {errorMessage && <p className="error-message">{errorMessage}</p>}
                {successMessage && <p className="success-message">{successMessage}</p>}
                <button type="submit" className="submit-button">Share</button>
                <button type="button" className="cancel-button" onClick={() => { /* Handle cancel action */ }}>Cancel</button>
            </form>
        </div>
    );
}

export default CreatePost;
